import React from 'react';
import { Link } from 'react-router-dom';

function App() {
    return (
        <div>
            <h1>Welcome to FinTrack</h1>
            <nav>
                <Link to="/signup">Signup</Link>
                <br />
                <Link to="/login">Login</Link>
            </nav>
        </div>
    );
}

export default App;
